import React, { useState } from 'react';
import './PortfolioForm.css';

function PortfolioForm() {
  const [portfolio, setPortfolio] = useState({
    username: '',
    fullName: '',
    email: '',
    role: '',
    aboutMe: '',
    mobile: '',
    linkedin: '',
    github: '',
    skills: '',
    projects: '',
    experience: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setPortfolio({
      ...portfolio,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    // Create the payload based on the portfolio state
    const payload = {
      username: portfolio.username,
      fullName: portfolio.fullName,
      email: portfolio.email,
      role: portfolio.role,
      about_me: portfolio.aboutMe,
      mobile: portfolio.mobile,
      linkedin: portfolio.linkedin,
      github: portfolio.github,
      skill_list: portfolio.skills.split(',').map(skill => ({ skillName: skill.trim() })),  // Assuming skills are entered as comma-separated values
      project_list: portfolio.projects.split(',').map(project => ({ projectName: project.trim() })),  // Assuming projects are entered as comma-separated values
      experience_Portfolio: portfolio.experience.split(',').map(experience => ({ experienceTitle: experience.trim() })) // Assuming experience is entered as comma-separated values
    };

    // Send a POST request to the backend
    fetch('http://localhost:8081/api/portfolio', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify(payload),
    })
      .then(response => response.json())
      .then(data => {
        console.log('Success:', data);
        alert('Portfolio submitted successfully!');
      })
      .catch((error) => {
        console.error('Error:', error);
        alert('Failed to submit portfolio.');
      });
  };

  return (
    <div>
      <h1>Submit Portfolio Details</h1>
      <form onSubmit={handleSubmit}>
        <label>
          Username:
          <input type="text" name="username" value={portfolio.username} onChange={handleChange} required />
        </label>
        <br />

        <label>
          Full Name:
          <input type="text" name="fullName" value={portfolio.fullName} onChange={handleChange} required />
        </label>
        <br />

        <label>
          Email:
          <input type="email" name="email" value={portfolio.email} onChange={handleChange} required />
        </label>
        <br />

        <label>
          Role:
          <input type="text" name="role" value={portfolio.role} onChange={handleChange} required />
        </label>
        <br />

        <label>
          About Me:
          <textarea name="aboutMe" value={portfolio.aboutMe} onChange={handleChange} required />
        </label>
        <br />

        <label>
          Mobile:
          <input type="text" name="mobile" value={portfolio.mobile} onChange={handleChange} required />
        </label>
        <br />

        <label>
          LinkedIn:
          <input type="text" name="linkedin" value={portfolio.linkedin} onChange={handleChange} />
        </label>
        <br />

        <label>
          GitHub:
          <input type="text" name="github" value={portfolio.github} onChange={handleChange} />
        </label>
        <br />

        <label>
          Skills (comma-separated):
          <input type="text" name="skills" value={portfolio.skills} onChange={handleChange} />
        </label>
        <br />

        <label>
          Projects (comma-separated):
          <input type="text" name="projects" value={portfolio.projects} onChange={handleChange} />
        </label>
        <br />

        <label>
          Experience (comma-separated):
          <input type="text" name="experience" value={portfolio.experience} onChange={handleChange} />
        </label>
        <br />

        <button type="submit">Submit Portfolio</button>
      </form>
    </div>
  );
}

export default PortfolioForm;
